<h1>#yycflood River Data</h1>

<p>#yycflood 2013 River Data Plots</p>

<p>This R analysis pulls river flow and height data from Alberta Environment, and generates a plot for both the Bow &amp; Elbow rivers showing flow-rate trends and normalized water levels (relative to pre-flood levels). </p>
